(1, 'Gullu Dada Thiree (Hindi)', 'uploads/853648179gulludada_2_230x360.jpg', 'uploads/425363915gulludada_125x210.jpg', 'uploads/2019744191gulludada_225x175.jpg', 'P', 'GULLU DADA THIREE is the third part of the Superhit Series Involving the Charachter Gullu dada. In this series Gullu dada is a social worker who falls for a girl who is unwillingly engaged to the brother of a Don. The story revovles around how Gullu and his gang of misfits try to help her. The movie also features the famous Aziz Naser as a petty thief and Akbar Bin Tabar as "ADVANCE" eventually all the characters are caught in a web of hilarious incidents ending with a jaw-dropping climax. This movie promises to give a new edge to the art of direction and cinematography. It is a complete family entertainer and the film makers (A.S.K CINEMA) are certain that it will be a rollercoaster ride for all', 18, 'Abrar Khan', 'Adnan Sajid Khan (Gullu Dada), \r\nAziz Naser,\r\nAkbar Bin Tabar,\r\nMogambo,\r\nDiksha Panth , \r\nMujtaba Ali Khan , \r\nMohd Toufeeq', 'Khalid Hameed', 126, NULL, '', 1350536400, 1348981200, '1358301180', '1358302380', '', 1347335621, 0, 1, 2, 3, 1350536400, '', 'http://www.facebook.com/zingreel', 'http://twitter.com/zingreelmovies', '', 0, 0, '0', 0, 0),
(2, 'Dream (Telugu)', 'uploads/1437152075Dreams_230_360_2.jpg', 'uploads/1088495435Dreams_125_210_1.jpg', 'uploads/1041464480Dreams_225_175_1.jpg', 'P', 'The protagonist, who is a retired army major is suffering from a rare disorder called Hypnogogue Delusions wherein he starts believing that his dreams are real and follows accordingly in reality\r\nEventually there is a story running in his dreams and there is a story in his real life. At a particular stage he misses the demarcation and gets confused with dream and reality. What follows is a dangerous phase of his life turning to total chaos. Story slowly drives the audience in to the mind of protagonist. The puzzles faced by the protagonist are experienced by the audience. Audience will find it difficult to differentiate between dream and reality. The thrilling journey never rests till the end', 39, 'K Bhavani Shanker', 'Rajendra prasad, Jayashree, Pavani reddy, Vinay varma, Prabhu', 'Rajesh, AR Rehman School of Music', 126, NULL, '', 1348203600, 0, '', '', '', 1347440235, 0, 2, 1, 1, 0, 'Stay tuned ...		', 'http://www.facebook.com/zingreel', 'http://twitter.com/zingreelmovies', '', 0, 0, '0', 0, 0),
(3, 'Kalicharan (Telugu)', 'uploads/953685742kalicharan_230x360.jpg', 'uploads/813024312kalicharan_125x210.jpg', 'uploads/1756813359kalicharan_225x175.jpg', 'P', ' Director Praveen Sri is a protege of Ram Gopal Varma, He has already a successful track record of directing the movie Gayam-2. As a very technically qulaified director Praveen started his movie direction career with a short film Souls with no artists. Praveen is very passionate about movie direction right from his college days.\r\nHis current project Kalicharan is all set to hit the box office with a bang. Kalicharan is an action based political flick and the most interesting thing is the film is based on a real incident which happened in 1980s. Let''s wait and watch what the director wants to convey his audience thru Kalicharan', 16, 'Sri Prawin', 'Chaitanya Krishna, Chandini, Nagineedu, Rao Raesh, Pankaj Keshri, Kavita Srinivasan, Naveena', 'Nandan Raj', 120, NULL, '', 1353571200, 0, '', '', '', 1347519587, 1, 0, 1, 24, 0, 'Stay tuned ...				', 'http://www.facebook.com/zingreel', 'http://twitter.com/zingreelmovies', NULL, 0, 0, '0', 0, 0),
(4, 'D/o Ramgopal Varma(Telugu)', 'uploads/1316798512230x360.jpg', 'uploads/1500037375125x210.jpg', 'uploads/752834735225x175.jpg', 'P', 'The hero - Vennela Kishore is a popular celebrity who maintains short term relationships with many girls who often hold a crush on him. With the usual playboy lifestyle he accidently becomes the father of a girl child when he comes into relationship with the heroin - Kavitha Aaras. \r\nAfter learning about his teen daughter - Naveena Jackson he starts living with her and that''s when he realizes the value of the relationships in life. Another point worth sharing here is actress Roja has comeback after a long gap in a very commanding role. \r\n\r\nWatch this movie by Khaja who is very certain to amuse the audience with several hilarious moments. Khaja holds a Ph.D in theater and also wears another feather in the cap as a recipient of Nandi award nine times', 40, 'Khaja', 'Vennela Kishore, \r\n           Naveena Jackson as Daughter,\r\n           Kavitha Aaras as Heroin ,\r\n           Roja,\r\n           Jeeva,\r\n           Uttej,\r\n           Melkote,\r\n           Joginaidu,\r\n           Dhanraj,\r\n           Chanti,\r\n           Fish venkat,\r\n           Shani,\r\n           Master veeren', 'Adesh Ravi', 120, NULL, '', 1359093600, 0, '1359537240', '1359551640', '', 1353919639, 0, 4, 2, 4, 0, '', 'http://facebook.com/zingreel', 'http://twitter.com/zingreelmovies', '', 1, 1, '0', 0, 0),
(5, 'Krishna Loves Geetha(Telugu)', 'uploads/539170200230x360.jpg', 'uploads/566016331125x210.jpg', 'uploads/453538934225x175.jpg', 'P', 'Krishna a very good friend and lovely brother and dear son of his parents falls in love with Geetha hailing from a poor family. But Geetha tries to contantly refuse him because of his villainy brother yet moves friendly with Krishna. Many twists leads the story and the Geetha makes a commitment to marry a rich guy Narendra who promises to finance Geetha to treat her sick mother who is in need of money.\r\n\r\nWatch this interesting lovestory how Krishna wins her love. The kannada version of this movie already won four film fare awards', 41, 'Shashank', 'Ajay Rao (Krishna), Radhika Pandith (Geetha), Umashree, Achutha, Padmaja Rao, Chandru, Pradeep, Sharan, Yogesh', 'Sridhar V. Sambram', 93, NULL, '', 1358488800, 0, '1359698400', '1363780800', '', 1354602573, 1, 6, 4, 5, 0, '', 'http://facebook.com/zingreel', 'http://twitter.com/zingreelmovies', '1', 1, 1, '5', 0, 0),
(6, 'John Carter(English)', 'uploads/109770502812349933jc_size2.jpg', 'uploads/7179610161014949862jc_size1.jpg', 'uploads/1614447637979193422jc_land.jpg', 'P', 'John Carter is an English Movie', 16, 'Ram', 'Krishna, Ram, Bharath, Laxman', 'Ram', 120, NULL, '', 1359007200, 0, '1359082800', '1364389200', '', 1358964852, 1, 6, 0, 6, 0, '', 'http://facebook.com/zingreel', 'http://twitter.com/zingreelmovies', '1', 0, 0, '1', 0, 0),
(7, 'Batman Dark Night', 'uploads/249008991mov_2_s1.jpg', 'uploads/143851123mov_2_s2.jpg', 'uploads/803585096mov_2_s3.jpg', 'P', 'When Batman, Gordon and Harvey Dent launch an assault on the mob, they let the clown out of the box, the Joker, bent on turning Gotham on itself and bringing any heroes down to his level. ', 16, 'Christopher Nolan', 'Monique Gabriela Curnen, Michael Caine, \r\n\r\nAaron Eckhart, Maggie Gyllenhaal and Christian Bale', 'Christopher Nolan', 93, NULL, '', 1357797600, 0, '1361289600', '1361808000', '', 1359175166, 1, 6, 4, 7, 0, '', 'http://facebook.com/zingreel', 'http://twitter.com/zingreelmovies', '2', 1, 1, '1', 0, 0),
(9, 'I AM The Legend', 'uploads/1081753868mov_3_s1.jpg', 'uploads/235460369mov_3_s2.jpg', 'uploads/238372059mov_3_s3.jpg', 'P', 'Bring out the bugles for the biggest celluloid celebration in a long, long time. God bless Rajkumar Hirani for ending an otherwise mediocre Bollywood year on a smashing note. You go in to see 3 Idiots expecting the genius combination of Hirani and Aamir Khan to weave magic on screen. But despite the mental conditioning, the impact of the film is so overwhelming that it leaves you spellbound for hours after it has ended.\r\nBased on Chetan Bhagat''s novel, Five Point Someone (though only a miniscule part has been adapted from the book; the rest is all original), here''s a story of three friends studying in an engineering college Rancho (Aamir Khan), Farhan (R Madhavan) and Raju (Sharman Joshi)\r\n', 17, 'rajamouli', 'Will Smith, Natalie portman', 'keeravani', 90, NULL, '', 1359266400, 0, '1360893600', '1364266800', '', 1359181167, 1, 20, 4, 9, 0, '', 'http://facebook.com/zingreel', 'http://twitter.com/zingreelmovies', '1', 0, 0, '1', 0, 0),
(10, '21 Jump Street', 'uploads/969997127mov_1_s1.jpg', 'uploads/472971874mov_1_s2.jpg', 'uploads/1559141661mov_1_s3.jpg', 'P', 'The protagonist, who is a retired army major is suffering from a rare disorder called Hypnogogue Delusions wherein he starts believing that his dreams are real and follows accordingly in reality\r\nEventually there is a story running in his dreams and there is a story in his real life. At a particular stage he misses the demarcation and gets confused with dream and reality. What follows is a dangerous phase of his life turning to total chaos. Story slowly drives the audience in to the mind of protagonist. The puzzles faced by the protagonist are experienced by the audience. Audience will find it difficult to differentiate between dream and reality. The thrilling journey never rests till the end.', 18, 'asdf', 'nag, nayanthara..', 'jkl', 3, NULL, '', 1360994400, 0, '1361031600', '1361253540', '', 1359198441, 0, 6, 4, 10, 0, '', 'http://facebook.com/zingreel', 'http://twitter.com/zingreelmovies', '2', 1, 1, '1', 0, 0),
(15, 'Chemistry (Telugu)', 'uploads/1706129550230x360.jpg', 'uploads/2000455818125x210.jpg', 'uploads/1877302659225x175.jpg', 'P', 'The hero (Sriram) in this movie gets fixed in his mind that girls are the evil cause of the problems in most of the love relationships. When he falls in love with the heroine (Amitha), he comes up with a formula to address the problems that arise tbecause of girls. Watch Vachespathy''s Chemistry to know more about chemical formula between hearts.\r\n', 26, 'Vachespathy', 'Sriram, Amitha Rao', 'Ghantasala Vishwanath', 137, NULL, '', 1362031200, -64800, '1361995200', '1363150800', '', 1360500964, 1, 6, 4, 15, -64800, '', 'http://facebook.com/zingreel', 'http://twitter.com/zingreelmovies', '2', 1, 1, '1', 0, 0),
(16, 'pokiri', 'uploads/1084163277810136079p3.jpg', 'uploads/164163567655320545881013607ass9p3.jpg', 'uploads/1086581051764046626p2.jpg', 'P', 'From filmmaker Andrew Stanton comes John Carter-a sweeping action-adventure set on the mysterious and exotic planet of Barsoom (Mars). John Carter is based on a classic novel by Edgar Rice Burroughs, whose highly imaginative adventures served as inspiration for many filmmakers, both past and present. The film tells the story of war-weary, former military captain John Carter (Taylor Kitsch), who is inexplicably transported to Mars where he becomes reluctantly embroiled in a conflict of epic proportions amongst the inhabitants of the planet, including Tars Tarkas (Willem Dafoe) and the captivating Princess Dejah Thoris (Lynn Collins). In a world on the brink of collapse, Carter rediscovers his humanity when he realizes that the survival of Barsoom and its people rests in his hands. -- (C) Walt Disney', 16, 'Andrew Stanton', 'mahesh babu, Ileana', 'manisharma', 150, NULL, '', 1360882800, 0, '1361804400', '1369000800', '', 1360911032, 1, 20, 4, 16, 0, '', 'http://facebook.com/zingreel', 'http://twitter.com/zingreelmovies', '2', 1, 1, '2', 88, 0),
(20, 'Play (Telugu)', 'uploads/1808465565310240412Play_Movie_Detailed_Page.jpg', 'uploads/217660352572020792play_portrait.jpg', 'uploads/45460154760491616play_landscape.jpg', 'P', 'All of us at some point of time in childhood must have played the game of spirits or heard about them. Debutant director Krishna Varma who worked as an assistant in Lakshyam brings an interesting and a very engaging two hour story that has five friends arguing about the existence of God and devil and then squatting for a game on the Ouija Board. The game boasts of calling the spirit of the dead and having conversations with it.\r\n\r\nPlay begins in a posh apartment introducing the characters and how they are led into playing the game. The director shows that he has the chops to handle such a highly complicated theme, and on a parallel level giving us a clear character sketch of the five friends and making one feel as if you are one amongst them involved in the process and outcome of the game.\r\n\r\nThe film shifts from being a comedy, adventure, thriller as it keeps one guessing of the next move.', 29, 'Krishna Verma', 'Ashok, Nikki (Trinath), Gopi, Subhash,Shanti (Srilakshmi)', 'Gopi Varma', 120, NULL, '', 1352613600, 0, '1361066400', '1364306400', 'Thriller, Spirit', 1361025901, 1, 17, 0, 20, 0, '', 'http://facebook.com/zingreel', 'http://twitter.com/zingreelmovies', '1', 1, 1, '1', 0, 0),
(21, 'Avathar', 'uploads/1635329982586692351avatar2.jpg', 'uploads/12154426111953535799avatar1.jpg', 'uploads/2114648882566233573landscape.jpg', 'P', 'The protagonist, who is a retired army major is suffering from a rare disorder called Hypnogogue Delusions wherein he starts believing that his dreams are real and follows accordingly in reality\r\nEventually there is a story running in his dreams and there is a story in his real life. At a particular stage he misses the demarcation and gets confused with dream and reality. What follows is a dangerous phase of his life turning to total chaos. Story slowly drives the audience in to the mind of protagonist. The puzzles faced by the protagonist are experienced by the audience. Audience will find it difficult to differentiate between dream and reality. The thrilling journey never rests till the end.', 23, 'Cameroon', 'William hemsworth, natalie portman', 'harris', 100, NULL, '', 1361253600, 0, '1361462400', '1361721600', '', 1361255972, 1, 20, 4, 21, 0, '', 'http://facebook.com/zingreel', 'http://twitter.com/zingreelmovies', '1', 1, 1, '1', 0, 0),
