INSERT INTO `moviedataLIVE` (`ID`, `MovieTitle`, `MovieImage`, `MovieWallImageP`, `MovieWallImageL`, `MovieImgType`, `MovieDescription`, `MovieGenre`, `MovieDirector`, `MovieCast`, `MovieMusic`, `MovieLength`, `MovieFrom`, `MovieReleaseCountry`, `MovieReleaseDate`, `MovieTicketBlockingDate`, `Broadcast_Start_Time`, `Broadcast_End_Time`, `MovieTags`, `MovieAddedOn`, `MovieApprove`, `ProducerID`, `ComingSoon`, `Score`, `TentativeShowDate`, `movie_block_date_msg`, `movie_fb_link`, `movie_twitter_link`) VALUES
(1, 'Gullu Dada Thiree (Hindi)', 'uploads/853648179gulludada_2_230x360.jpg', 'uploads/425363915gulludada_125x210.jpg', 'uploads/2019744191gulludada_225x175.jpg', 'P', 'GULLU DADA THIREE is the third part of the Superhit Series Involving the Charachter Gullu dada. In this series Gullu dada is a social worker who falls for a girl who is unwillingly engaged to the brother of a Don. The story revovles around how Gullu and his gang of misfits try to help her. The movie also features the famous Aziz Naser as a petty thief and Akbar Bin Tabar as "ADVANCE" eventually all the characters are caught in a web of hilarious incidents ending with a jaw-dropping climax. This movie promises to give a new edge to the art of direction and cinematography. It is a complete family entertainer and the film makers (A.S.K CINEMA) are certain that it will be a rollercoaster ride for all', 18, 'Abrar Khan', 'Adnan Sajid Khan (Gullu Dada), \r\nAziz Naser,\r\nAkbar Bin Tabar,\r\nMogambo,\r\nDiksha Panth , \r\nMujtaba Ali Khan , \r\nMohd Toufeeq', 'Khalid Hameed', 126, NULL, '', 1350536400, 1348981200, '1350608400', '1350615300', '', 1347335621, 0, 1, 2, 3, 1350536400, '', 'http://www.facebook.com/zingreel', 'http://twitter.com/zingreelmovies'),
(2, 'Dream (Telugu)', 'uploads/1437152075Dreams_230_360_2.jpg', 'uploads/1088495435Dreams_125_210_1.jpg', 'uploads/1041464480Dreams_225_175_1.jpg', 'P', 'The protagonist, who is a retired army major is suffering from a rare disorder called Hypnogogue Delusions wherein he starts believing that his dreams are real and follows accordingly in reality\r\nEventually there is a story running in his dreams and there is a story in his real life. At a particular stage he misses the demarcation and gets confused with dream and reality. What follows is a dangerous phase of his life turning to total chaos. Story slowly drives the audience in to the mind of protagonist. The puzzles faced by the protagonist are experienced by the audience. Audience will find it difficult to differentiate between dream and reality. The thrilling journey never rests till the end', 39, 'K Bhavani Shanker', 'Rajendra prasad, Jayashree, Pavani reddy, Vinay varma, Prabhu', 'Rajesh, AR Rehman School of Music', 126, NULL, '', 1348210800, 0, '', '', '', 1347440235, 1, 2, 1, 1, 0, 'Stay tuned ...', 'http://www.facebook.com/zingreel', 'http://twitter.com/zingreelmovies'),
(3, 'Kalicharan (Telugu)', 'uploads/953685742kalicharan_230x360.jpg', 'uploads/813024312kalicharan_125x210.jpg', 'uploads/1756813359kalicharan_225x175.jpg', 'P', ' Director Praveen Sri is a protege of Ram Gopal Varma, He has already a successful track record of directing the movie Gayam-2. As a very technically qulaified director Praveen started his movie direction career with a short film Souls with no artists. Praveen is very passionate about movie direction right from his college days.\r\nHis current project Kalicharan is all set to hit the box office with a bang. Kalicharan is an action based political flick and the most interesting thing is the film is based on a real incident which happened in 1980s. Let''s wait and watch what the director wants to convey his audience thru Kalicharan', 16, 'Sri Prawin', 'Chaitanya Krishna, Chandini, Nagineedu, Rao Raesh, Pankaj Keshri, Kavita Srinivasan, Naveena', 'Nandan Raj', 120, NULL, '', 1353571200, 0, '', '', '', 1347519587, 1, 3, 1, 2, 0, 'Stay tuned ...				', 'http://www.facebook.com/zingreel', 'http://twitter.com/zingreelmovies'),
(4, 'D/o Ramgopal Varma(Telugu)', 'uploads/1316798512230x360.jpg', 'uploads/1500037375125x210.jpg', 'uploads/752834735225x175.jpg', 'P', 'The hero - Vennela Kishore is a popular celebrity who maintains short term relationships with many girls who often hold a crush on him. With the usual playboy lifestyle he accidently becomes the father of a girl child when he comes into relationship with the heroin - Kavitha Aaras. \r\nAfter learning about his teen daughter - Naveena Jackson he starts living with her and that''s when he realizes the value of the relationships in life. Another point worth sharing here is actress Roja has comeback after a long gap in a very commanding role. \r\n\r\nWatch this movie by Khaja who is very certain to amuse the audience with several hilarious moments. Khaja holds a Ph.D in theater and also wears another feather in the cap as a recipient of Nandi award nine times', 40, 'Khaja', 'Vennela Kishore, \r\n           Naveena Jackson as Daughter,\r\n           Kavitha Aaras as Heroin ,\r\n           Roja,\r\n           Jeeva,\r\n           Uttej,\r\n           Melkote,\r\n           Joginaidu,\r\n           Dhanraj,\r\n           Chanti,\r\n           Fish venkat,\r\n           Shani,\r\n           Master veeren', 'Adesh Ravi', 120, NULL, '', 1355551200, 0, '', '', '', 1353919639, 1, 4, 1, 4, 0, '		    		    		    		    Stay tuned...\r\n												', 'http://facebook.com/zingreel', 'http://twitter.com/zingreelmovies'),
(5, 'Krishna Loves Geetha(Telugu)', 'uploads/539170200230x360.jpg', 'uploads/566016331125x210.jpg', 'uploads/453538934225x175.jpg', 'P', 'Krishna a very good friend and lovely brother and dear son of his parents falls in love with Geetha hailing from a poor family. But Geetha tries to contantly refuse him because of his villainy brother yet moves friendly with Krishna. Many twists leads the story and the Geetha makes a commitment to marry a rich guy Narendra who promises to finance Geetha to treat her sick mother who is in need of money.\r\n\r\nWatch this interesting lovestory how Krishna wins her love. The kannada version of this movie already won four film fare awards', 41, 'Shashank', 'Ajay Rao (Krishna), Radhika Pandith (Geetha), Umashree, Achutha, Padmaja Rao, Chandru, Pradeep, Sharan, Yogesh', 'Sridhar V. Sambram', 137, NULL, '', 1356069600, 0, '1358564400', '1358582400', '', 1354602573, 1, 5, 2, 6, 0, '', 'http://facebook.com/zingreel', 'http://twitter.com/zingreelmovies'),
(6, 'Case No.666/2013(Telugu)', 'uploads/21324342057-english_230_360.png', 'uploads/13435766967-english_125_210.png', 'uploads/11626283703-english_225_175.png', 'P', 'Case No. 666/2013 is the first Telugu Film in the "Found Footage" genre in its 80 years span. It is the story of friends going missing under mysterious circumstances. The movie is made in a shoe string budget with an amazing crew who dared to work in pitch dark, that too in deep forest areas.\r\n\r\nWorth watching this interesting project by Venkat', 42, 'Venkat SiddaReddy', 'Charan Tej, Aditya, Nanda Kishore, Guru Charan, Anurag, Nikitha , Ashwini', 'Ethiraj, Shyamal', 120, NULL, '', 1359180000, -64800, '1359257400', '1359262800', '', 1358354428, 1, 6, 2, 5, -64800, '', 'http://www.facebook.com/zingreel', 'http://www.twitter.com/zingreelmovies');
