(1, 'contactus', '<p>&nbsp;</p>\r\n<p>&nbsp;</p>'),
(2, 'privacy_policy', '<p>Zingreel services are brought out by Anvish Technologies Private Limited where user privacy is paramount and the Service Provider makes and earnest endeavor to safeguard the privacy of its Users subject to the terms hereunder. Our Privacy Policy may change from time to time. You are deemed to have accepted any changes and revision to the private policy if you continue to use the Services.</p>\r\n<h2>COLLECTION OF INFORMATION:</h2>\r\n<p>We collect information to provide better services to all of our users. Our services require you to sign up for a Zingreel Account. When you do, we&rsquo;ll ask for personal information like your name, email address, telephone number, country of residence or credit card. We may collect information about the services that you use and how you use them, like when you visit a website that uses our advertising services or you view and interact with our ads and content such as your hardware model, operating system version, unique device identifiers, and mobile network information including phone number. When you use our services. we may automatically collect and store certain information inserver logs. which&nbsp; may include (a) details of how you used our service, such as your search queries, (b) Internet Protocol Address (b) device event information such as crashes, system activity, hardware settings, browser type, browser language, the date and time of your request and referral URL (c) cookies that may uniquely identify your browser or your Zingreel Account. <br />\r\n<br />\r\nWe use various technologies to collect and store information when you visit a Zingreel service, and this may include sending one or more cookies or anonymous identifiers to your device. We also use cookies and anonymous identifiers when you interact with services we offer to our partners, such as advertising services or Zingreel features that may appear on other sites.</p>\r\n<h2>USE OF INFORMATION</h2>\r\n<p>We use the information we collect from our services to provide, maintain, protect and improve our Services, to develop new ones, and to protect Zingreel and our users. We may use the information to inform you about our products, services, promotional events or special offers and about upcoming changes or improvements. We work hard to protect Zingreel and our users from unauthorized access to or unauthorized alteration, disclosure or destruction of information we hold <br />\r\n<br />\r\nWe will ask for your consent before using information for a purpose other than those that are set out in this Privacy Policy. We will share personal information with companies, organizations or individuals outside of Zingreel when we have your consent to do so.</p>\r\n<h2>For External Use</h2>\r\n<p>We provide personal information to our affiliates or other trusted businesses or persons to process it for us, based on our instructions and in compliance with our Privacy Policy and any other appropriate confidentiality and security measures. We will share personal information with companies, organizations or individuals outside of Zingreel if we have a good-faith belief that access, use, preservation or disclosure of the information is reasonably necessary to:</p>\r\n<ul>\r\n    <li>meet any applicable law, regulation, legal process or enforceable governmental request.</li>\r\n    <li>enforce applicable Terms of Service, including investigation of potential violations.</li>\r\n    <li>detect, prevent, or otherwise address fraud, security or technical issues.</li>\r\n    <li>protect against harm to the rights, property or safety of Zingreel, our users or the public as required or permitted by law.</li>\r\n</ul>\r\n<p><br />\r\nWe may share aggregated, non-personally identifiable information publicly and with our partners &ndash; like publishers, advertisers or connected sites. For example, we may share information publicly to show trends about the general use of our services.<br />\r\n<br />\r\nIf Zingreel is involved in a merger, acquisition or asset sale, we will continue to ensure the confidentiality of any personal information and give affected users notice before personal information is transferred or becomes subject to a different privacy policy.</p>\r\n<h2>LINKS</h2>\r\n<p>Our Privacy Policy does not apply to services offered by other companies or individuals, including products or sites that may be displayed to you in search results, sites that may include Zingreel services, or other sites linked from our services. Our Privacy Policy does not cover the information practices of other companies and organizations who advertise our services, and who may use cookies, pixel tags and other technologies to serve and offer relevant ads.<br />\r\nCONTACT US<br />\r\n<br />\r\nIf you have any questions or comments about this policy, please contact us by email at <a href=\\"\\\\&quot;mailto:support@zingreel.com?subject=zingreel%20query&amp;body=want%20to%20know%20more\\\\&quot;\\">support@zingreel.com</a></p>\r\n<p>&nbsp;</p>'),
(3, 'terms_of_service', '<p class=\\"\\\\&quot;\\\\\\\\&quot;MsoNormal\\\\\\\\&quot;\\\\&quot;\\">Zingreel services are brought out by Anvish Technologies Private Limited where user privacy is paramount and the Service Provider makes and earnest endeavor to safeguard the privacy of its Users subject to the terms hereunder. Our Privacy Policy may change from time to time. You are deemed to have accepted any changes and revision to the private policy if you continue to use the Services. </p>'),
