(5, 'faq', '<p style="font:normal 9pt arial;color:#555454;line-height:20px;padding:7px 0;">\r\n<span style="color:#bebebe;font-weight:bold;"><strong>Does the show time correspond to my local time?</strong></span><br />\r\nYes.<br />\r\n<br />\r\n<span style="color:#bebebe;font-weight:bold;"><strong>How does this work? </strong></span><br />\r\nPlease refer to our <a href="http://zingreel.com/how-it-works.php" >How it Works page </a> </strong></span><br />\r\n<br />\r\n<span style="color:#bebebe;font-weight:bold;"><strong>Does zingreel charge my credit card if I block the ticket?</strong></span><br />\r\nNo, Ticket blocking is free but you have to key in the credit card details<br />\r\n<br />\r\n<span style="color:#bebebe;font-weight:bold;"><strong>What does the percentage blocked bar indicates?</strong></span><br />\r\nIt indicates the number of people blocked the show expressing the intent to watch the movie. The red mark indicates the expected number of blockings by the movie producer. The green color indicates the number of people blocked the tickets progressively for a given show<br />\r\n<br/>\r\n<img width="198px" height="11px" src="img/blockBarDemo.png" />\r\n<br />\r\n<br />\r\n\r\n<span style="color:#bebebe;font-weight:bold;"><strong>I have blocked the ticket, When is the movie broadcasted?</strong></span><br />\r\nThe movie will be broadcast only if sufficient number of people blocks the ticket and the green color in the percentage blocked bar crosses red mark ateleast four days before the show date. Sometimes it is up to the movie producer to broadcast the movie even if the green color does not cross red in the percentage blocked bar<br />\r\n<br />\r\n\r\n<span style="color:#bebebe;font-weight:bold;"><strong>I did not watch the movie even after the movie is broadcast. Does zingreel charge my credit card?</strong></span><br />\r\nYes, Zingreel charges the blocked users once the movie is broadcast whether one watches the movie or not<br />\r\n<br />\r\n\r\n<span style="color:#bebebe;font-weight:bold;"><strong>I have blocked the ticket, When is my card charged?</strong></span><br />\r\nYour card will be charged only after the movie is broadcast irrespective of you watched or not<br />\r\n<br />\r\n\r\n<span style="color:#bebebe;font-weight:bold;"><strong>I have blocked the ticket, Does zingreel intimate me about the movie broadcast?</strong></span><br />\r\nYes, Zingreel sends a reminder mail when the producer confirms the movie broadcast<br />\r\n<br />\r\n\r\n<span style="color:#bebebe;font-weight:bold;"><strong>Where can i get frequent updates about the upcoming movies on zingreel?</strong></span><br />\r\nPlease follow us at our face book page - <a href="http://facebook.com/zingreel" >facebook.com/zingreel</a> or twitter at <a href="http://twitter.com/zingreelmovies">twitter.com/zingreelmovies</a> or keep visitng our website <a href="http://zingreel.com"> http://zingreel.com</a> <br />\r\n<br />\r\n\r\n<span style="color:#bebebe;font-weight:bold;"><strong>What will happen to my ticket if the show is cancelled?</strong></span><br />\r\nYou will not be charged anything for this. The amount is not captured till the producer okays the show. In case the producer does not okay, the paypal transaction will be voided from our application.<br />\r\n<br />\r\n<span style="color:#bebebe;font-weight:bold;"><strong>I reside in a country where USD is not the official currency and if I make a transaction in zingreel, will there be any conversion charges?</strong></span><br />\r\nYes, the currency charges are in addition to ticket blocked amount. It depends on the country you belong to<br />\r\n<br />\r\n<span style="color:#bebebe;font-weight:bold;"><strong>Why should I block the ticket in advance?</strong></span><br />\r\nZingreel empowers the crowd to demand the online broadcast of latest and greatest movies from the producer, on the same day of release. Zingreel achieves this by allowing the crowd to block the ticket early and show the intent to watch online. If the number of tickets blocked is as per producer&rsquo;s expectations, the movie will be broadcast. So if more people block tickets, better are the chances of the broadcast.<br />\r\n<br />\r\n<span style="color:#bebebe;font-weight:bold;"><strong>When I try to block the ticket, i get the error &quot;This movie is not available for viewing in your region&quot;. What does this mean?</strong></span><br />\r\nZingreel does not broadcast movies to the countries/areas where the movies are released in local theaters to protect the interest of the distributors. Also sometimes the producer would not be interested to broadcast to some countries based on certain preference. If you have the movie released in a theater near to you, you may not be able to watch the movie online. <br />\r\n<br />\r\n<span style="color:#bebebe;font-weight:bold;"><strong>Once I block the ticket, how should I watch the movie?</strong></span><br />\r\nOn the show date and time, please click on the ''Watch movie'' button to watch the movie.<br />\r\n<br />\r\n<span style="color:#bebebe;font-weight:bold;"><strong>Is telephone verification mandatory?</strong></span><br />\r\nYes<br />\r\n<br />\r\n<span style="color:#bebebe;font-weight:bold;"><strong>Why should I perform the telephone verification?</strong></span><br />\r\nTo protect the interest of the movie producer, every user is required to do telephone verification<br />\r\n<br />\r\n<span style="color:#bebebe;font-weight:bold;"><strong>Will I be charged additionally for telephone verification?</strong></span><br />\r\nNo<br />\r\n<br />\r\n<span style="color:#bebebe;font-weight:bold;"><strong>What if the verification fails twice?</strong></span><br />\r\nYou will have one last option to verify the telephone number, by clicking on the ''Watch Movie'' button before watching the movie.<br />\r\n<br />\r\n<span style="color:#bebebe;font-weight:bold;"><strong>What if the Telephone verification fails all the three times?</strong></span><br />\r\nYou will not be allowed to watch the movie. The ticket amount may not be refunded.<br />\r\n<br />\r\n<span style="color:#bebebe;font-weight:bold;"><strong>Is zingreel available only for Telugu movies?</strong></span><br />\r\nNo, We are planning to bring more and more content to all the NRIs - irrespective of the language. First few could be from Tollywood though.<br />\r\n<br />\r\n<span style="color:#bebebe;font-weight:bold;"><strong>Can I watch movies on this site from India?</strong></span><br />\r\nCurrently No. We are working with several payment gateway services to extend the service to Indian audience. Besides this it is up to the movie producer to release the movie in specific country ( or countries)<br />\r\n<br />\r\n<span style="color:#bebebe;font-weight:bold;"><strong>What does DRM mean?</strong></span><br />\r\nDigital Rights Management: It is a bit complex to explain in short sentences. There is lot of information available online; you can refer to any of the links.&nbsp; In general, the purpose of DRM is to prevent people from using copyrighted materials in ways that the publisher does not want them to use it. In some countries, bypassing DRM is almost always a crime.<br />\r\n<br />\r\n<span style="color:#bebebe;font-weight:bold;"><strong>Are the videos in zingreel, DRM enabled?</strong></span><br />\r\nYes.<br />\r\n<br />\r\n<span style="color:#bebebe;font-weight:bold;"><strong>Can i watch the show on Television?</strong></span><br />\r\nNo, the show is going to be broadcast only to computers at the moment - that too only to windows PCs and Laptops because of the DRM issues. We are working on the DRM solution to broadcast the movies to TVs, handheld devices and to computers based on other operating systems and in a couple of months it will be ready<br />\r\n<br />\r\n<span style="color:#bebebe;font-weight:bold;"><strong>Can i connect my PC to Television to watch movies over TV?</strong></span><br />\r\nNo, the DRM solution does not allow that<br />\r\n<br />\r\n<span style="color:#bebebe;font-weight:bold;"><strong>Mine is not a windows computer, can i watch the show?</strong></span><br />\r\nNo, the DRM solution does not allow the movie broadcast to be played on a non windows computer<br />\r\n<br />\r\n<span style="color:#bebebe;font-weight:bold;"><strong>What if I am charged after blocking the ticket?</strong></span><br />\r\nPlease contact support@zingreel.com to resolve the conflict.<br />\r\n&nbsp;</p>'),
